import React from 'react'
import NumbersTable from '../../numbersTable'

const BiztoolCell = (props) => {

  return (
    <div>
      {props.type == 'text' &&
        <input
          type='text'
          className="column border border-primary"
          style={{
            width: `${props.width}px`,
            textAlign: `start`,
          }}
          onChange={e => props.onCellChange(props.type, props.address.tableId, props.address.rowId, props.colIndex, e)}
          value={props.data}
        />}
      {props.type == 'money' &&
        <input
          type='money'
          className="column border border-primary"
          style={{
            width: `${props.width}px`,
            textAlign: `start`,
          }}
          onChange={e => props.onCellChange(props.type, props.address.tableId, props.address.rowId, props.colIndex, e)}
          value={props.data}
        />}
      {props.type == 'number' &&
        <input
          type='number'
          className="column border border-primary"
          style={{
            width: `${props.width}px`,
            textAlign: `start`,
          }}
          onChange={e => props.onCellChange(props.type, props.address.tableId, props.address.rowId, props.colIndex, e)}
          value={props.data}
        />}
      {props.type == 'date' &&
        <input
          type='date'
          className="column border border-primary"
          style={{
            width: `${props.width}px`,
            textAlign: `start`,
          }}
          onChange={e => props.onCellChange(props.type, props.address.tableId, props.address.rowId, props.colIndex, e)}
          value={props.data}
        />}


      {props.type == 'asset-account-dropdown' &&
        <input
          type='text'
          className="column border border-primary"
          style={{
            width: `${props.width}px`,
            textAlign: `start`,
          }}
          onChange={e => props.onCellChange(props.type, props.address.tableId, props.address.rowId, props.colIndex, e)}
          value={props.data}
        />}
      {props.type == 'cost-increase-dropdown' &&
        <input
          type='text'
          className="column border border-primary"
          style={{
            width: `${props.width}px`,
            textAlign: `start`,
          }}
          onChange={e => props.onCellChange(props.type, props.address.tableId, props.address.rowId, props.colIndex, e)}
          value={props.data}
        />}
      {props.type == 'period-dropdown' &&
        <input
          type='text'
          className="column border border-primary"
          style={{
            width: `${props.width}px`,
            textAlign: `start`,
          }}
          onChange={e => props.onCellChange(props.type, props.address.tableId, props.address.rowId, props.colIndex, e)}
          value={props.data}
        />}

      {props.type == 'numbers-table' &&
        <NumbersTable
          data={props.data.name}
          colIndex={props.colIndex}
          tableType={props.type}
          onCellChange={props.onCellChange}
          address={props.address}
          width={props.width}
        />}


    </div>
  )
}

export default BiztoolCell
